// ==UserScript==
// @name        DeviantArt Icon Change
// @namespace   sollace
// @icon        https://raw.githubusercontent.com/Sollace/UserScripts/master/DA++/logo.png
// @include     http://*.deviantart.*
// @include     https://*.deviantart.*
// @include     http://sta.sh*
// @include     https://sta.sh*
// @version     1.4
// @grant       none
// @run-at      document-start
// ==/UserScript==

var STASH = 'data:image/png;base64,';
var FAVICON = 'data:image/x-icon;base64,';
var LOGO = 'http://fc00.deviantart.net/fs70/i/2014/341/8/e/da_logo_concept_by_comeha-d893jng.png';
var FULL_LOGO = 'http://img04.deviantart.net/4c1a/i/2014/342/8/2/da_logo_concept_2_by_comeha-d8949mm.png';
var HOLS = 'data:image/png;base64,';
var done = false;

var startupFunction = (function() {
  var load_done = false;
  return function() {
    if (!load_done) {
      load_done = true;
      changeLogo(LOGO, FAVICON, HOLS);
    }
  }
})();

if (document.location.hostname.indexOf('.deviantart.') != -1) {
  document.addEventListener('DOMContentLoaded', startupFunction);
  document.onmousemove = function() {
    changeLogo(LOGO, FAVICON, HOLS);
  }
  changeLogo(LOGO, FAVICON, HOLS);
}

function changeLogo() {
  var head = document.head;
  if (!isJQuery()) {
    if (typeof document.head === 'undefined') {
      var svg = el('svg');
      if (svg.length) {
        head = svg.eq(0);
      }
    }
    if (head === null) {
      head = el('head');
      head = head.length ? head.eq(0) : null;
    }
  }
  
  var target = el('#deviantart-logo .mark');
  if (target.length) {
    target.html('<img style="margin-left:-10px" height="30px" src="' + LOGO + '" />');
  }
  target = el('#holiday_logo_a');
  if (target.length) {
    target.attr('src', HOLS);
  }
  if (isJQuery()) {
    target = el('img[src*=".deviantart.net/emoticons/r/rabbithole.png"], img[src*=".deviantart.net/emoticons/d/deviantart.png"]');
    if (target.length) {
      target.attr({
        'src': LOGO,
        'width': '19px',
        'height': '12px'
      }).css({
        'width': '19px',
        'height': '12px'
      });
    }
  }
  
  if (!done) {
    if (head != null) {
      target = el('head link[rel="shortcut icon"]');
      if (target.length) {
        done = true;
        target.remove();
      }
      var link = document.createElement('LINK');
      link.setAttribute('href', FAVICON);
      link.setAttribute('rel', 'shortcut icon');
      link.setAttribute('xmlns', 'http://www.w3.org/1999/xhtml');
      if (head.children.length) {
        head.insertBefore(link, head.children[0]);
      } else {
        head.appendChild(link);
      }
    }
    doStyle();
  }
}

function doStyle() {
  var target = el('#iconStyle');
  if (!target.length) {
    style('\
@font-face{\
	  font-family:"usersymbol-icons-old";\
	    src:url("//st.deviantart.net/misc/symbols/deviantart-symbols2.eot");\
	    src:url("//st.deviantart.net/misc/symbols/deviantart-symbols2_iefix.eot") format("embedded-opentype"),url("//st.deviantart.net/misc/symbols/deviantart-symbols2.woff") format("woff"),url("//st.deviantart.net/misc/symbols/deviantart-symbols2.ttf") format("truetype"),url("//st.deviantart.net/misc/symbols/deviantart-symbols2.svg#deviantart-symbols-icons") format("svg");\
	  font-weight:normal;\
	  font-style:normal;\
	  font-variant:normal}\
span.user-symbol.admin {\
    font-family: usersymbol-icons-old !important;}\
\
.oh-stashmain > #oh-mainmenu a.mi .iddqd,\
.dev-page-view .dev-right-bar-title.more-from-da-title {\
    background: url(' + LOGO + ') no-repeat 0px 5px/25px auto !important;}\
\
.stash-create .bubble-button.ile_edit_in_writer .creamy-center > i, .stash-create .bubble-button.ile_edit_in_muroimport .creamy-center > i, .stash-create .bubble-button.ile_edit_in_muro .creamy-center > i, .edit_buttons .bubble-button .creamy-center > i, .stash-edit .bubble-button .creamy-center > i, .dev-page-view .dev-view-meta .edit-buttons .creamy-center > i {\
    background-image: url(' + STASH + ') !important;}\
\
.daheader h1 a {\
    background-image: url(' + FULL_LOGO + ') !important;\
    background-size: 100% auto !important;}\
', 'iconStyle');
  }
}

function el(select) {
  if (isJQuery()) return $(select);
  var objects = document.querySelectorAll(select);
  objects = objects === null ? [] : objects;
  return wrap(objects);
}
function wrap(objects) {
  return {
    attr: function(name, value) {
      if (value === undefined) {
        return objects[0].getAttribute(name);
      }
      for (var i = 0; i < objects.length; i++) {
        objects[i].setAttribute(name, value);
      }
    },
    eq: function(index) {
      return objects[index];
    },
    html: function(html) {
      if (html === undefined) {
        return objects[0].innerHTML;
      }
      for (var i = 0; i < objects.length; i++) {
        objects[i].innerHTML = html;
      }
    },
    remove: function() {
      for (var i = 0; i < objects.length; i++) {
        objects[i].parentNode.removeChild(objects[i]);
      }
    },
    first: function() {
      return wrap([objects[0]]);
    },
    prepend: function(html) {
      if (typeof html.html === 'function') html = html.html();
      for (var i = 0; i < objects.length; i++) {
        objects[i].innerHTML = html + objects[i].innerHTML;
      }
    },
    length: objects.length
  }
}

function isJQuery() {
  return window['$'] && $.prototype.html;
}

function style(css, id) {
  var tag = document.createElement('STYLE');
  tag.type = 'text/css';
  tag.innerHTML = css;
  document.head.appendChild(tag);
  if (id) tag.setAttribute('id', id);
  return tag;
}